import React from "react"
import ExpenseForm from "./ExpenseForm"

const AddNewExpense = () => {
    const generateForm = () => {
        return <ExpenseForm />
    }

    return (<div>
        <button className='new-expense__actions' type='submit'
            onClick={generateForm}>Add New Expense</button>
    </div>
    )
}

export default AddNewExpense
